@testset "1.2.1.9 P(x) (d+e x)^m (a+b x+c x^2)^p" begin
    @variables A, B, C, a, b, c, d, e, f, g, h, i, j, k, l, m, p, q, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*P2(x)*(d+e*x)^m*(a+b*x+c*x^2)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*P2(x)*(d+e*x)^m*(a+b*x+c*x^2)^p*when*b=0*and*c*d^2+a*e^2=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*P2(x)*(d+e*x)^m*(d^2-e^2*x^2)^p=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(d + e*x)^2*(A + B*x + C*x^2)*sqrt(d^2 - e^2*x^2), x, 7, (d^2*(3*C*d^2 + 4*B*d*e + 10*A*e^2)*x*sqrt(d^2 - e^2*x^2))/(16*e^2) - (d*(4*C*d^2 + e*(7*B*d + 10*A*e))*(d^2 - e^2*x^2)^(3/2))/(15*e^3) - ((3*C*d^2 + 2*e*(2*B*d + A*e))*x*(d^2 - e^2*x^2)^(3/2))/(8*e^2) - ((2*C*d + B*e)*x^2*(d^2 - e^2*x^2)^(3/2))/(5*e) - (1/6)*C*x^3*(d^2 - e^2*x^2)^(3/2) + (d^4*(3*C*d^2 + 4*B*d*e + 10*A*e^2)*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(16*e^3)]
    @test_int [(d + e*x)^1*(A + B*x + C*x^2)*sqrt(d^2 - e^2*x^2), x, 6, (d*(C*d^2 + e*(B*d + 4*A*e))*x*sqrt(d^2 - e^2*x^2))/(8*e^2) - ((2*C*d^2 + 5*e*(B*d + A*e))*(d^2 - e^2*x^2)^(3/2))/(15*e^3) - ((C*d + B*e)*x*(d^2 - e^2*x^2)^(3/2))/(4*e^2) - (C*x^2*(d^2 - e^2*x^2)^(3/2))/(5*e) + (d^3*(C*d^2 + e*(B*d + 4*A*e))*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(8*e^3)]
    @test_int [(d + e*x)^0*(A + B*x + C*x^2)*sqrt(d^2 - e^2*x^2), x, 5, (1/8)*(4*A + (C*d^2)/e^2)*x*sqrt(d^2 - e^2*x^2) - (B*(d^2 - e^2*x^2)^(3/2))/(3*e^2) - (C*x*(d^2 - e^2*x^2)^(3/2))/(4*e^2) + (d^2*(C*d^2 + 4*A*e^2)*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(8*e^3)]
    @test_int [(A + B*x + C*x^2)*sqrt(d^2 - e^2*x^2)/(d + e*x)^1, x, 5, ((C*d^2 - e*(B*d - 2*A*e))*sqrt(d^2 - e^2*x^2))/(2*e^3) - (C*(d^2 - e^2*x^2)^(3/2))/(3*e^3) + ((C*d - B*e)*(d^2 - e^2*x^2)^(3/2))/(2*e^3*(d + e*x)) + (d*(C*d^2 - e*(B*d - 2*A*e))*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(2*e^3)]
    @test_int [(A + B*x + C*x^2)*sqrt(d^2 - e^2*x^2)/(d + e*x)^2, x, 5, -(((5*C*d^2 - 2*e*(2*B*d - A*e))*sqrt(d^2 - e^2*x^2))/(2*d*e^3)) - ((C*d^2 - B*d*e + A*e^2)*(d^2 - e^2*x^2)^(3/2))/(d*e^3*(d + e*x)^2) - (C*(d^2 - e^2*x^2)^(3/2))/(2*e^3*(d + e*x)) - ((5*C*d^2 - 2*e*(2*B*d - A*e))*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(2*e^3)]
    @test_int [(A + B*x + C*x^2)*sqrt(d^2 - e^2*x^2)/(d + e*x)^3, x, 5, (2*(3*C*d - B*e)*sqrt(d^2 - e^2*x^2))/(e^3*(d + e*x)) - ((C*d^2 - B*d*e + A*e^2)*(d^2 - e^2*x^2)^(3/2))/(3*d*e^3*(d + e*x)^3) - (C*(d^2 - e^2*x^2)^(3/2))/(e^3*(d + e*x)^2) + ((3*C*d - B*e)*atan((e*x)/sqrt(d^2 - e^2*x^2)))/e^3]
    @test_int [(A + B*x + C*x^2)*sqrt(d^2 - e^2*x^2)/(d + e*x)^4, x, 8, -((2*C*sqrt(d^2 - e^2*x^2))/(e^3*(d + e*x))) - ((C*d^2 - B*d*e + A*e^2)*(d^2 - e^2*x^2)^(3/2))/(5*d*e^3*(d + e*x)^4) + ((2*C*d - B*e)*(d^2 - e^2*x^2)^(3/2))/(3*d*e^3*(d + e*x)^3) - ((C*d^2 - B*d*e + A*e^2)*(d^2 - e^2*x^2)^(3/2))/(15*d^2*e^3*(d + e*x)^3) - (C*atan((e*x)/sqrt(d^2 - e^2*x^2)))/e^3]
    @test_int [(A + B*x + C*x^2)*sqrt(d^2 - e^2*x^2)/(d + e*x)^5, x, 4, -(((C*d^2 - B*d*e + A*e^2)*(d^2 - e^2*x^2)^(3/2))/(7*d*e^3*(d + e*x)^5)) + (C*(d^2 - e^2*x^2)^(3/2))/(e^3*(d + e*x)^4) - ((23*C*d^2 + e*(5*B*d + 2*A*e))*(d^2 - e^2*x^2)^(3/2))/(35*d^2*e^3*(d + e*x)^4) - ((23*C*d^2 + e*(5*B*d + 2*A*e))*(d^2 - e^2*x^2)^(3/2))/(105*d^3*e^3*(d + e*x)^3)]
    @test_int [(A + B*x + C*x^2)*sqrt(d^2 - e^2*x^2)/(d + e*x)^6, x, 5, -(((C*d^2 - B*d*e + A*e^2)*(d^2 - e^2*x^2)^(3/2))/(9*d*e^3*(d + e*x)^6)) + (C*(d^2 - e^2*x^2)^(3/2))/(2*e^3*(d + e*x)^5) - ((11*C*d^2 + 2*e*(2*B*d + A*e))*(d^2 - e^2*x^2)^(3/2))/(42*d^2*e^3*(d + e*x)^5) - ((11*C*d^2 + 2*e*(2*B*d + A*e))*(d^2 - e^2*x^2)^(3/2))/(105*d^3*e^3*(d + e*x)^4) - ((11*C*d^2 + 2*e*(2*B*d + A*e))*(d^2 - e^2*x^2)^(3/2))/(315*d^4*e^3*(d + e*x)^3)]


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [(d + e*x)^3*(A + B*x + C*x^2)/sqrt(d^2 - e^2*x^2), x, 7, -((d^2*(38*C*d^2 + 45*B*d*e + 55*A*e^2)*sqrt(d^2 - e^2*x^2))/(15*e^3)) - (d*(13*C*d^2 + 15*B*d*e + 12*A*e^2)*x*sqrt(d^2 - e^2*x^2))/(8*e^2) - ((19*C*d^2 + 5*e*(3*B*d + A*e))*x^2*sqrt(d^2 - e^2*x^2))/(15*e) - (1/4)*(3*C*d + B*e)*x^3*sqrt(d^2 - e^2*x^2) - (1/5)*C*e*x^4*sqrt(d^2 - e^2*x^2) + (d^3*(13*C*d^2 + 15*B*d*e + 20*A*e^2)*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(8*e^3)]
    @test_int [(d + e*x)^2*(A + B*x + C*x^2)/sqrt(d^2 - e^2*x^2), x, 6, -((d*(4*C*d^2 + e*(5*B*d + 6*A*e))*sqrt(d^2 - e^2*x^2))/(3*e^3)) - ((7*C*d^2 + 4*e*(2*B*d + A*e))*x*sqrt(d^2 - e^2*x^2))/(8*e^2) - ((2*C*d + B*e)*x^2*sqrt(d^2 - e^2*x^2))/(3*e) - (1/4)*C*x^3*sqrt(d^2 - e^2*x^2) + (d^2*(7*C*d^2 + 8*B*d*e + 12*A*e^2)*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(8*e^3)]
    @test_int [(d + e*x)^1*(A + B*x + C*x^2)/sqrt(d^2 - e^2*x^2), x, 5, -(((2*C*d^2 + 3*e*(B*d + A*e))*sqrt(d^2 - e^2*x^2))/(3*e^3)) - ((C*d + B*e)*x*sqrt(d^2 - e^2*x^2))/(2*e^2) - (C*x^2*sqrt(d^2 - e^2*x^2))/(3*e) + (d*(C*d^2 + e*(B*d + 2*A*e))*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(2*e^3)]
    @test_int [(d + e*x)^0*(A + B*x + C*x^2)/sqrt(d^2 - e^2*x^2), x, 4, -((B*sqrt(d^2 - e^2*x^2))/e^2) - (C*x*sqrt(d^2 - e^2*x^2))/(2*e^2) + ((C*d^2 + 2*A*e^2)*atan((e*x)/sqrt(d^2 - e^2*x^2)))/(2*e^3)]
    @test_int [(A + B*x + C*x^2)/((d + e*x)^1*sqrt(d^2 - e^2*x^2)), x, 4, -((C*sqrt(d^2 - e^2*x^2))/e^3) - ((C*d^2 - B*d*e + A*e^2)*sqrt(d^2 - e^2*x^2))/(d*e^3*(d + e*x)) - ((C*d - B*e)*atan((e*x)/sqrt(d^2 - e^2*x^2)))/e^3]
    @test_int [(A + B*x + C*x^2)/((d + e*x)^2*sqrt(d^2 - e^2*x^2)), x, 7, -(((C*d^2 - B*d*e + A*e^2)*sqrt(d^2 - e^2*x^2))/(3*d*e^3*(d + e*x)^2)) + ((2*C*d - B*e)*sqrt(d^2 - e^2*x^2))/(d*e^3*(d + e*x)) - ((C*d^2 - B*d*e + A*e^2)*sqrt(d^2 - e^2*x^2))/(3*d^2*e^3*(d + e*x)) + (C*atan((e*x)/sqrt(d^2 - e^2*x^2)))/e^3]
    @test_int [(A + B*x + C*x^2)/((d + e*x)^3*sqrt(d^2 - e^2*x^2)), x, 4, -(((C*d^2 - B*d*e + A*e^2)*sqrt(d^2 - e^2*x^2))/(5*d*e^3*(d + e*x)^3)) + (C*sqrt(d^2 - e^2*x^2))/(e^3*(d + e*x)^2) - ((7*C*d^2 + e*(3*B*d + 2*A*e))*sqrt(d^2 - e^2*x^2))/(15*d^2*e^3*(d + e*x)^2) - ((7*C*d^2 + e*(3*B*d + 2*A*e))*sqrt(d^2 - e^2*x^2))/(15*d^3*e^3*(d + e*x))]
    @test_int [(A + B*x + C*x^2)/((d + e*x)^4*sqrt(d^2 - e^2*x^2)), x, 5, -(((C*d^2 - B*d*e + A*e^2)*sqrt(d^2 - e^2*x^2))/(7*d*e^3*(d + e*x)^4)) + (C*sqrt(d^2 - e^2*x^2))/(2*e^3*(d + e*x)^3) - ((13*C*d^2 + 8*B*d*e + 6*A*e^2)*sqrt(d^2 - e^2*x^2))/(70*d^2*e^3*(d + e*x)^3) - ((13*C*d^2 + 8*B*d*e + 6*A*e^2)*sqrt(d^2 - e^2*x^2))/(105*d^3*e^3*(d + e*x)^2) - ((13*C*d^2 + 8*B*d*e + 6*A*e^2)*sqrt(d^2 - e^2*x^2))/(105*d^4*e^3*(d + e*x))]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*P2(x)*(d+e*x)^m*(a+b*x+c*x^2)^p*when*b=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d+e*x)^m*(a+c*x^2)^p*(A+B*x+C*x^2)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(d + e*x)^3*(A + B*x + C*x^2)*(a + c*x^2), x, 2, ((c*d^2 + a*e^2)*(C*d^2 - B*d*e + A*e^2)*(d + e*x)^4)/(4*e^5) - ((a*e^2*(2*C*d - B*e) + c*d*(4*C*d^2 - e*(3*B*d - 2*A*e)))*(d + e*x)^5)/(5*e^5) + ((a*C*e^2 + c*(6*C*d^2 - e*(3*B*d - A*e)))*(d + e*x)^6)/(6*e^5) - (c*(4*C*d - B*e)*(d + e*x)^7)/(7*e^5) + (c*C*(d + e*x)^8)/(8*e^5)]
    @test_int [(d + e*x)^2*(A + B*x + C*x^2)*(a + c*x^2), x, 2, ((c*d^2 + a*e^2)*(C*d^2 - B*d*e + A*e^2)*(d + e*x)^3)/(3*e^5) - ((a*e^2*(2*C*d - B*e) + c*d*(4*C*d^2 - e*(3*B*d - 2*A*e)))*(d + e*x)^4)/(4*e^5) + ((a*C*e^2 + c*(6*C*d^2 - e*(3*B*d - A*e)))*(d + e*x)^5)/(5*e^5) - (c*(4*C*d - B*e)*(d + e*x)^6)/(6*e^5) + (c*C*(d + e*x)^7)/(7*e^5)]
    @test_int [(d + e*x)^1*(A + B*x + C*x^2)*(a + c*x^2), x, 2, a*A*d*x + (1/2)*a*(B*d + A*e)*x^2 + (1/3)*(A*c*d + a*C*d + a*B*e)*x^3 + (1/4)*(B*c*d + A*c*e + a*C*e)*x^4 + (1/5)*c*(C*d + B*e)*x^5 + (1/6)*c*C*e*x^6]
    @test_int [(d + e*x)^0*(A + B*x + C*x^2)*(a + c*x^2), x, 2, a*A*x + (1/2)*a*B*x^2 + (1/3)*(A*c + a*C)*x^3 + (1/4)*B*c*x^4 + (1/5)*c*C*x^5]
    @test_int [(A + B*x + C*x^2)*(a + c*x^2)/(d + e*x)^1, x, 2, -(((a*e^2*(C*d - B*e) + c*d*(C*d^2 - e*(B*d - A*e)))*x)/e^4) + ((a*C*e^2 + c*(C*d^2 - e*(B*d - A*e)))*x^2)/(2*e^3) - (c*(C*d - B*e)*x^3)/(3*e^2) + (c*C*x^4)/(4*e) + ((c*d^2 + a*e^2)*(C*d^2 - B*d*e + A*e^2)*log(d + e*x))/e^5]
    @test_int [(A + B*x + C*x^2)*(a + c*x^2)/(d + e*x)^2, x, 2, ((a*C*e^2 + c*(3*C*d^2 - e*(2*B*d - A*e)))*x)/e^4 - (c*(2*C*d - B*e)*x^2)/(2*e^3) + (c*C*x^3)/(3*e^2) - ((c*d^2 + a*e^2)*(C*d^2 - B*d*e + A*e^2))/(e^5*(d + e*x)) - ((a*e^2*(2*C*d - B*e) + c*d*(4*C*d^2 - e*(3*B*d - 2*A*e)))*log(d + e*x))/e^5]
    @test_int [(A + B*x + C*x^2)*(a + c*x^2)/(d + e*x)^3, x, 2, -((c*(3*C*d - B*e)*x)/e^4) + (c*C*x^2)/(2*e^3) - ((c*d^2 + a*e^2)*(C*d^2 - B*d*e + A*e^2))/(2*e^5*(d + e*x)^2) + (a*e^2*(2*C*d - B*e) + c*d*(4*C*d^2 - e*(3*B*d - 2*A*e)))/(e^5*(d + e*x)) + ((a*C*e^2 + c*(6*C*d^2 - e*(3*B*d - A*e)))*log(d + e*x))/e^5]


    @test_int [(d + e*x)^3*(A + B*x + C*x^2)*(a + c*x^2)^2, x, 3, a^2*A*d^3*x + (1/3)*a*d*(a*d*(C*d + 3*B*e) + A*(2*c*d^2 + 3*a*e^2))*x^3 + (1/4)*a^2*e*(3*C*d^2 + e*(3*B*d + A*e))*x^4 + (1/5)*(A*c*d*(c*d^2 + 6*a*e^2) + a*(a*e^2*(3*C*d + B*e) + 2*c*d^2*(C*d + 3*B*e)))*x^5 + (1/6)*a*e*(a*C*e^2 + 2*c*(3*C*d^2 + e*(3*B*d + A*e)))*x^6 + (1/7)*c*(2*a*e^2*(3*C*d + B*e) + c*d*(C*d^2 + 3*e*(B*d + A*e)))*x^7 + (1/8)*c*e*(2*a*C*e^2 + c*(3*C*d^2 + e*(3*B*d + A*e)))*x^8 + (1/9)*c^2*e^2*(3*C*d + B*e)*x^9 + (1/10)*c^2*C*e^3*x^10 + (d^2*(B*d + 3*A*e)*(a + c*x^2)^3)/(6*c)]
    @test_int [(d + e*x)^2*(A + B*x + C*x^2)*(a + c*x^2)^2, x, 3, a^2*A*d^2*x + (1/3)*a*(a*d*(C*d + 2*B*e) + A*(2*c*d^2 + a*e^2))*x^3 + (1/4)*a^2*e*(2*C*d + B*e)*x^4 + (1/5)*(A*c*(c*d^2 + 2*a*e^2) + a*(a*C*e^2 + 2*c*d*(C*d + 2*B*e)))*x^5 + (1/3)*a*c*e*(2*C*d + B*e)*x^6 + (1/7)*c*(2*a*C*e^2 + c*(C*d^2 + e*(2*B*d + A*e)))*x^7 + (1/8)*c^2*e*(2*C*d + B*e)*x^8 + (1/9)*c^2*C*e^2*x^9 + (d*(B*d + 2*A*e)*(a + c*x^2)^3)/(6*c)]
    @test_int [(d + e*x)^1*(A + B*x + C*x^2)*(a + c*x^2)^2, x, 3, a^2*A*d*x + (1/3)*a*(2*A*c*d + a*C*d + a*B*e)*x^3 + (1/4)*a^2*C*e*x^4 + (1/5)*c*(A*c*d + 2*a*(C*d + B*e))*x^5 + (1/3)*a*c*C*e*x^6 + (1/7)*c^2*(C*d + B*e)*x^7 + (1/8)*c^2*C*e*x^8 + ((B*d + A*e)*(a + c*x^2)^3)/(6*c)]
    @test_int [(d + e*x)^0*(A + B*x + C*x^2)*(a + c*x^2)^2, x, 3, a^2*A*x + (1/3)*a*(2*A*c + a*C)*x^3 + (1/5)*c*(A*c + 2*a*C)*x^5 + (1/7)*c^2*C*x^7 + (B*(a + c*x^2)^3)/(6*c)]
    @test_int [(A + B*x + C*x^2)*(a + c*x^2)^2/(d + e*x)^1, x, 2, -(((a^2*e^4*(C*d - B*e) + c^2*d^3*(C*d^2 - e*(B*d - A*e)) + 2*a*c*d*e^2*(C*d^2 - e*(B*d - A*e)))*x)/e^6) + ((a^2*C*e^4 + c^2*d^2*(C*d^2 - e*(B*d - A*e)) + 2*a*c*e^2*(C*d^2 - e*(B*d - A*e)))*x^2)/(2*e^5) - (c*(2*a*e^2*(C*d - B*e) + c*d*(C*d^2 - e*(B*d - A*e)))*x^3)/(3*e^4) + (c*(2*a*C*e^2 + c*(C*d^2 - e*(B*d - A*e)))*x^4)/(4*e^3) - (c^2*(C*d - B*e)*x^5)/(5*e^2) + (c^2*C*x^6)/(6*e) + ((c*d^2 + a*e^2)^2*(C*d^2 - B*d*e + A*e^2)*log(d + e*x))/e^7]
